import { StyleSheet, View, Text } from 'react-native';
import React from 'react';
import { Card, Title, Paragraph } from 'react-native-paper';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';
import { faAngleRight } from "@fortawesome/free-solid-svg-icons";

export default function CardTest(props) {
    const {item} = props
    console.log(item);
    return (
        <Card key={item.id} style={styles.card}>
            <Card.Content>
                <Title>{item.name}</Title>
                <Paragraph style={styles.paragraph}>{item.job}</Paragraph>
            </Card.Content>
            <View style={{ padding: 5, backgroundColor: "#F23030", position: "absolute", top: "22%", left: "95%", border: 'solid', borderColor: "#fc8686", borderWidth: 6, borderRadius: "25%" }}>
            </View>
        </Card>
    )
}

const styles = StyleSheet.create({
    card: {
        width: 290,
        padding: 15,
        borderRadius: 20,
        position: "relative",
        height: 130,
        marginTop: 30
    },
    paragraph: {
        fontSize: 12,
        color: "#606060"
    }
});
